  return (
    <div className="App">
      <header>
        <h1>Capture Sketch</h1>
      </header>

      <main>
        {/* p5.jsのスケッチ */}
        <div>
          <SampleSketch />
        </div>
        <div>
          <button>a</button>
        </div>

        {/* <Button /> */}
      </main>

    </div>
  );
}

